import React from "react";
import "./Pages/styles/Selector.css"


function Selector() {
    return (
        <>
            <div className="radio">
                <input className="radio__input" type="radio" value="option1" name="myRadio" id="myRadio1"/>
                <label className="radio__label" for="myRadio1"> Option 1</label>
            </div>
        </>
    )
}

export default Selector;
